import React from "react";
import './Menu.css'

const Menu = () => {
    return (
        <div className="navbar">
            <img src="./logo.svg" alt="logo" className="App-logo"/>
            <ul>
                <li>Home</li>
                <li>Products</li>
                <li>About</li>
            </ul>
        </div>
    )
}

export default Menu;
